urpose of verifying or identifying the Customer when accessing the Services and for the purpose of verifying or identifying the Customer when accessing the Services. And providing services to customers \n5.3 To verify customer service usage information In accordance with the safety and security standards of the service Management and Protection of Information Technology Infrastructure \n5.4 To contact customers via social network, telephone, text message (SMS), e-mail (E-mail) or post, or through any channel to inquire or notify customers. Or check and verify the customer\'s account information Or poll Or provide any other information related to the service of the company as necessary \n5.5 To process Analyze any other benefits related to the Company\'s business operations. \n5.6 To develop products, services and increase efficiency in providing various services to customers. \n5.7 To prevent or suppress any harm to life, body or health of the customer. Including the customer\'s property Or is necessary for the performance of duties for the public interest of the company Or perform duties in exercising the power of the state given to the company or employees or representatives of the company. Or is it legal practice \n\n6. Disclosure of personal information to third parties \n\nThe company will not disclose customers\' personal information to any person without the customer\'s consent. In any case, except to disclose only as specified by law. In the event that the customer believes that the person with whom the Company discloses the personal information of the customer above or the customer\'s personal information is used for purposes other than the scope of the company, the customers can notify the company for further action. \nIn this regard, the company will disclose personal information of customers under the regulations stipulated by law such as disclosure to government agencies Government agencies The agency responsible for governing the service Or customer regulators including in the event of a lawful disclosure request, such as a request for information for prosecution or legal proceedings or is a request from a private agency or other third parties involved in legal processes. \n\n7. Rights of Personal Data Subject \n\n7.1 The data subject has the right to be informed of the methods, collection procedures. \n7.2 Right to request access to personal information. \n7.3 Right to object to collection, use or disclosure of personal information. \n7.4 Right to request erasure or destruction or make personal information non-personally identifiable information. \n\n8.Access and update of personal information \n\n8.1 In the event that the customer does not wish to receive information and press releases from the company, please notify At pdpa@fusionsol.com \n8.2 In the event that the customer wishes to correct the personal information, Suspend the use of personal information, Object to collection, use or disclosure of personal information, Object to processing of personal data, proceed to delete personal information from the system and Withdraw the consent that has been given to the Company for the collection, use or disclosure of personal information, or there is any failure in connection with it. You can contact at pdpa@fusionsol.com \n8.3 In the event that the customer wishes to be informed of the availability, Characteristics of personal information, Purpose of using the customer\'s personal information or requesting the company to disclose the acquisition of personal information. \nContact the Personal Data Protection Officer E-mail: pdpa@fusionsol.com \nThe company will consider and notify the result of consideration of the request within 30 days from the date the company receives such request. \nHowever, the company may refuse to exercise the rights of the customer under the conditions stipulated by law. If the company is unable to process the customer\'s request. The company will record the rejection of the request with reasons. \n\n9. Links to Third Party Websites, Applications, Products and Services \n\nThe Company\'s website may contain links to third-party websites, products and services. These third parties may collect certain information about their use of the services by The Company cannot be held responsible for the security or privacy of any customer information collected by such third-party websites, products or services. Customers should exercise caution and review the privacy policies of those third-party websites, products and services. \n\n10. Security measures for the storage of personal information \n\nThe company takes the security of personal information about or referring to customers very seriously. The company has appropriate security measures to prevent accidental loss of customer personal information, being used, accessed, changed or disclosed without permission. Company limited access to customer personal information for employees, agents, contractors and third parties with \'Needs to be informed. \n\n11. Application of Personal Information Protection Policy \n\nThis Privacy Policy applies to all personal data collected by the company. The client agrees that the company has the right to retain and take the Customer Personal Information that is currently stored by the company and to be stored in the future for use or disclosed to other parties within the scope as specified in this Privacy Policy. \n\n12. Contact channels \n\nThe company has assigned and appointed Ms. Kanchana Wangsuk to be the Data Protection Officer. By giving powers and duties as the Personal Data Protection Officer as stipulated by the Personal Data Protection Act 2019 and is the coordinator of personal information protection of the company Location: Fusion Solution Co., Ltd. 77/148 Sinsathorn Tower 34th Floor, Klong Ton Sai Subdistrict, Khlong San District, Bangkok In case there is a complaint about the company, Employees or employees of the company violate or fail to comply with the law.