      'vi':
          'Trong chính sách này, thuật ngữ \"cookie\" được sử dụng để chỉ cookie và các công nghệ tương tự khác tuân theo \"Đạo luật bảo vệ thông tin cá nhân\" với mục đích bảo vệ quyền riêng tư trong giao tiếp điện tử. \n\nCookie là gì? \n\nCookie là những thông tin mà các trang web yêu cầu trình duyệt của bạn lưu trữ trên máy tính hoặc thiết bị di động của bạn. Cookie giúp trang web \"ghi nhớ\" cách sử dụng và sở thích của người dùng. \nHầu hết các trình duyệt Internet đều hỗ trợ cookie. Tuy nhiên, người dùng có thể thiết lập trình duyệt của riêng mình không chấp nhận một số loại cookie nhất định. Ngoài ra, người dùng cũng có thể xóa cookie bất kỳ lúc nào. \n\nTại sao chúng tôi sử dụng cookie? \n\nChúng tôi sử dụng cookie để xác định cách bạn tương tác với nội dung trên trang web của chúng tôi và giúp cải thiện trải nghiệm của bạn khi bạn truy cập trang web của chúng tôi, ví dụ, một số cookie sẽ ghi nhớ lựa chọn ngôn ngữ hoặc cài đặt của bạn, do đó bạn không phải thiết lập lại khi quay lại trang web. \nChúng tôi cũng sử dụng cookie để giúp chúng tôi cung cấp cho bạn thông tin phù hợp, chẳng hạn như video trên trang web của chúng tôi. Chúng tôi có thể nghiên cứu hành vi của bạn trên Trang web để hiển thị quảng cáo có mục tiêu trên các trang web của bên thứ ba nhằm \"tiếp thị\" lại các sản phẩm và dịch vụ của chúng tôi cho bạn. \n\nChúng tôi sử dụng những loại cookie nào trên trang web của mình? \n\nCookie của chúng tôi và của bên thứ ba \n\nCookie của chúng tôi là cookie do tên miền của trang web phát hành',
      'zh_Hans':
