          'ဘာသာစကား ဆက်တင်ကို သတ်မှတ်ရန် ၎င်းကို ပုံမှန်အားဖြင့် အသုံးပြုသည်။ ဝဘ်ဆိုဒ်၏ အခြေခံအသုံးပြုမှုအတွက် ရလဒ်များကို ပြသရန် အသုံးပြုသူမှ ရွေးချယ်ထားသော အနေအထား \nThird party cookies များသည် Optimistic ၏ စီးပွားရေးလုပ်ဖော်ကိုင်ဖက်များ သို့မဟုတ် ဝန်ဆောင်မှုပေးသူများကဲ့သို့ ပြင်ပအဖွဲ့အစည်းများမှ စီမံခန့်ခွဲသည့် ကွတ်ကီးများဖြစ်သည်။ အလုပ်လျှောက်လွှာပုံစံကို တင်သွင်းခြင်းကဲ့သို့သော ဝဘ်ဆိုက်ပေါ်တွင် အချို့သောပုံစံများကို ပြသရန်အတွက် ဤ cookies များ လိုအပ်နိုင်ပါသည်။ သို့မဟုတ် Optimistic ၏ ဆိုက်ပြင်ပတွင် ကြော်ငြာခွင့်ပြုပါ။ \n\nကြားကာလ ကွတ်ကီးများ \n\nဤအရာများသည် ဝဘ်ဆိုက်သို့ သင်ဝင်ရောက်စဉ်တွင် သင့်အား အသိအမှတ်ပြုရန် အသုံးပြုသည့် ယာယီကွတ်ကီးများဖြစ်သည်။ သင်၏ ဝဘ်ဘရောက်ဆာကို ပိတ်သောအခါတွင် သက်တမ်းကုန်ဆုံးမည်ဖြစ်သည်။ \n\nအမြဲတမ်း ကွတ်ကီးများ \n\nဝဘ်ဆိုက်အတွင်းရှိ သင့်စိတ်ကြိုက်ရွေးချယ်မှုများကို မှတ်သားရန် အမြဲရှိနေသော ကွတ်ကီးများကို အသုံးပြုပါသည်။ သင်၏ဘရောက်ဆာကိုပိတ်ပြီး သို့မဟုတ် စက်အသစ်တစ်ခုဖွင့်လိုက်လျှင်ပင် ၎င်းသည် သင်၏ desktop သို့မဟုတ် မိုဘိုင်းစက်ပစ္စည်းပေါ်တွင် ရှိနေမည်ဖြစ်သည်။ သင့်အတွက် ဝဘ်ဆိုဒ်၏လုပ်ဆောင်ချက်များကို တိုးတက်ကောင်းမွန်လာစေရန်အတွက် အသုံးပြုသူ၏အပြုအမူကို ပိုင်းခြားစိတ်ဖြာရန် ကျွန်ုပ်တို့သည် ဤ cookies များကို အသုံးပြုပါသည်။ နှင့် Optimistic ၏ ဝဘ်ဆိုဒ်သို့ ဝင်ရောက်ကြည့်ရှုသူ အခြားသူများ။ ဤ cookies များသည် သင့်အား ပစ်မှတ်ထားသော ကြော်ငြာများဆီသို့ လမ်းညွှန်နိုင်စေပါသည်။ ပြီးတော့ ဆိုက်ရဲ့လုပ်ဆောင်ချက်တွေနဲ့ ကြော်ငြာတွေရဲ့ ထိရောက်မှုကိုလည်း တိုင်းတာနိုင်ပါတယ်။ \n\nကြော်ငြာရည်ရွယ်ချက်အတွက် ကွတ်ကီးများကို မည်သို့အသုံးပြုရကြောင်း ဥပမာများ ရှင်းလင်းချက်။ \n\nဝဘ်ဘီကွန်များ၊ ပစ်ဇယ်များနှင့် အမည်မသိကြော်ငြာကွန်ရက်တဂ်များကဲ့သို့သော ကွက်ကီးများနှင့် ကြော်ငြာနည်းပညာများ။ ၎င်းသည် သင်စိတ်ဝင်စားမည့် ကြော်ငြာများကို ပိုမိုထိရောက်စွာ ပေးပို့နိုင်စေပါသည်။ ဤနည်းပညာများသည် ပြန်လည်သုံးသပ်ရန်အတွက် စုပေါင်းအချက်အလက်များကို စုဆောင်းရာတွင်လည်း ကူညီပေးပါသည်။ သုတေသနလေ့လာမှုများနှင့် ကြော်ငြာကုမ္ပဏီများအတွက် စွမ်းဆောင်ရည်အစီရင်ခံစာများ ပြင်ဆင်ခြင်း။ Pixels သည် ကျွန်ုပ်တို့အား သင့်ထံသို့ ကြော်ငြာများပေးပို့ခြင်းကို နားလည်ပြီး ပိုမိုကောင်းမွန်လာစေရန်နှင့် မည်သည့်ကြော်ငြာများကို သင်ကြည့်ရှုခဲ့သည်ကို ကျွန်ုပ်တို့အား အသိပေးနိုင်သည့်အပြင် သင့်ဘရောက်ဆာသည် ကြော်ငြာကွန်ရက်ဆာဗာမှ ကြော်ငြာများနှင့် ဝဘ်ဘီကွန်များကို တိုက်ရိုက်ထုတ်ယူနိုင်သောကြောင့်ဖြစ်သည်။ ထို့နောက် အဆိုပါကွန်ရက်များသည် အဆိုပါကွန်ရက်၏ဆိုက်မှ ဝဘ်စာမျက်နှာများကို သင်ကိုယ်တိုင်ရယူရန် တောင်းဆိုနေသကဲ့သို့ ၎င်းတို့၏ကိုယ်ပိုင် cookies များကို ကြည့်ရှုခြင်း၊ ပြင်ဆင်ခြင်း သို့မဟုတ် သတ်မှတ်ခြင်းတို့ ပြုလုပ်နိုင်သည်။ \nအခြားဝဘ်ဆိုဒ်များ၏သမိုင်းကြောင်းမှ သင့်ပရိုဖိုင်ကိုတည်ဆောက်ရန် cookies များကို ကျွန်ုပ်တို့အသုံးမပြုသော်လည်း သက်ဆိုင်ရာကြော်ငြာများကိုပြသရန် ဤဝဘ်ဆိုဒ်များမှ စုစည်းအချက်အလက်များကို ကျွန်ုပ်တို့အသုံးပြုပါသည်။ သင်၏စိတ်ဝင်စားမှုများအရ ကျွန်ုပ်တို့သည် သင်၏ကိုယ်ရေးကိုယ်တာအချက်အလက်များကို ကြော်ငြာကုမ္ပဏီများထံ မယူပါ။ ပြင်ပအဖွဲ့အစည်းများကို အသိပေးသော ကြော်ငြာများ သို့မဟုတ် ကြော်ငြာများကို လက်ခံရရှိခြင်းမှ ရှောင်ဖယ်နိုင်ပါသည်။ သင့်စက်တွင် ကွတ်ကီးများကို သတ်မှတ်ခြင်းဖြင့်၊ ဤဆက်တင်သည် သင်သွားရောက်ကြည့်ရှုခဲ့သည့် စာမျက်နှာများမှ ကြော်ငြာများကို ပျောက်ပျက်သွားစေမည်မဟုတ်ပါ။ သို့သော် သင်ရရှိသောကြော်ငြာများသည် သင့်စိတ်ဝင်စားမှုနှင့် ကိုက်ညီမည်မဟုတ်ပါ။ ဆိုလိုသည်မှာ ကြော်ငြာများသည် cookies ကိုင်ဆောင်ထားသော သင်စိတ်ဝင်စားမှုများနှင့် ကိုက်ညီမည်မဟုတ်ပါ။ \nကျွန်ုပ်တို့၏ဝဘ်ဆိုဒ်အတွင်းရှိ အချို့သောလုပ်ဆောင်ချက်များအတွက်၊ ဥပမာအားဖြင့်၊ သင်ထည့်သွင်းထားသည့် YouTube ဗီဒီယိုများ သို့မဟုတ် YouTube ဗီဒီယိုများ သို့မဟုတ် လင့်ခ်များသို့ လင့်ခ်များပါရှိသော ဝဘ်စာမျက်နှာသို့ သင်သွားရောက်သည့်အခါတွင်၊ ကျွန်ုပ်တို့သည် ပြင်ပအဖွဲ့အစည်းများမှ ပံ့ပိုးပေးသော ဝန်ဆောင်မှုများကို အသုံးပြုပါမည်။ (တတိယပါတီမှ ပံ့ပိုးပေးသည့် အခြားအကြောင်းအရာများ) ပြင်ပအဖွဲ့အစည်း ကွတ်ကီးများ ပါဝင်နိုင်သည်။ \nကွတ်ကီးအသုံးပြုမှုအကြောင်း သိရှိနိုင်ရန် ဤပြင်ပဝဘ်ဆိုက်များ၏ ကိုယ်ရေးကိုယ်တာမူဝါဒများကို ပြန်လည်သုံးသပ်ရန် သင့်အား ကျွန်ုပ်တို့ တိုက်တွန်းပါသည်။ \n\nကွတ်ကီးတွေကို ဘယ်လိုငြင်းပြီး ဖျက်နိုင်မလဲ။ \n\nငြင်းပယ်ရန် သင်ရွေးချယ်နိုင်သည်။ သို့မဟုတ် သင့်အတွက် Optimistic ဝဘ်ဆိုက်မှ သတ်မှတ်ပေးထားသည့် ကွတ်ကီးများ သို့မဟုတ် အချို့သော ကွတ်ကီးများကို ပိတ်ဆို့ပါ။ ကျွန်ုပ်တို့၏ဝဘ်ဆိုက်ရှိ set cookies ခလုတ်ကို နှိပ်ခြင်းဖြင့် သင်သည် သင့်အတွက် သတ်မှတ်ထားသော ပြင်ပဝန်ဆောင်မှုပေးသူ၏ ဝဘ်ဆိုက်တွင် သင့်စိတ်ကြိုက်ရွေးချယ်မှုများကို ပြောင်းလဲနိုင်သည်။ သင့်ဘရောက်ဆာရှိ ဆက်တင်များကို ပြောင်းလဲခြင်းဖြင့် ဝဘ်ဘရောက်ဆာအများစုသည် ကွတ်ကီးများကို အလိုအလျောက်လက်ခံကြောင်း ကျေးဇူးပြု၍ ကျေးဇူးပြု၍ ကျေးဇူးပြု၍ သတိပြုပါ ကျေးဇူးပြု၍ ကျေးဇူးပြု၍ ကွတ်ကီးများကို အသုံးမပြုလိုပါက ကွတ်ကီးများကို ဆက်လက်ပိတ်ဆို့ခြင်း သို့မဟုတ် ဖျက်ခြင်းတို့ ပြုလုပ်ရန် လိုအပ်ပါသည်။ ကွတ်ကီးတွေကို သုံးဖို့ငြင်းရင် သင်သည် ကျွန်ုပ်တို့၏ဝဘ်ဆိုဒ်သို့ ဝင်ရောက်ကြည့်ရှုနိုင်ဆဲဖြစ်သည်။ သို့သော် ဝဘ်ဆိုက်ရှိ အချို့သောလုပ်ဆောင်ချက်များသည် မှန်ကန်သည် သို့မဟုတ် ၎င်းတို့ဖြစ်သင့်သလောက် မကောင်းနိုင်ပါ။ ငြင်းပယ်နည်းအသေးစိတ်များကို သင်ရှာဖွေနိုင်ပါသည်။ သို့မဟုတ် ကွတ်ကီးများကို ဖျက်ခြင်းအပြင် ကွတ်ကီးများအကြောင်း ယေဘူယျနောက်ထပ်အချက်အလက်များကို တွင် တွေ့နိုင်ပါသည်။ \n\nဝဘ်ဆိုဒ် ကွတ်ကီးများ- www.allaboutcookies.org/manage-cookies \n\nမိုဘိုင်းကွတ်ကီးများ- www.allaboutcookies.org/mobile/index.html \n\nအင်တာနက် ကြော်ငြာဗျူရို (IAB): www.youronlinechoices.com/uk/your-ad-choices \n\nNetwork Advertising Initiative (NAI): optout.networkadvertising.org/?c=1#!/ \n\nဒစ်ဂျစ်တယ်ကြော်ငြာမဟာမိတ် (DAA): digitaladvertisingalliance.org/ \n\nထိုကွတ်ကီးကို ဖျက်ခြင်း သို့မဟုတ် ငြင်းပယ်ခြင်းမရှိဘဲ ဝဘ်ဆိုက်တစ်ခုသို့ ဝင်ရောက်ကြည့်ရှုခြင်း။ သင့်စက်တွင် သင်မငြင်းပယ်သော ကွတ်ကီးများကို Optimistic သိမ်းဆည်းခွင့်ပြုရန် သင်သဘောတူသည်။ ကွတ်ကီးတွေကို ဘယ်လိုဖျက်မလဲ။ အောက်ပါလင့်ခ်များကို လိုက်နာခြင်းဖြင့် ကွတ်ကီးများကို ဖျက်နိုင်သည်- ဥပမာ၊ သင်အသုံးပြုရန် ရွေးချယ်ထားသော ဝဘ်ဘရောက်ဆာတွင်။ \n\nGoogle Chrome \n\nFirefox \n\nInternet Explorer \n\nဆာဖာရီ \n\nios အတွက် Safari \n\nAndroid အတွက် Chrome \n\nios အတွက် Chrome \n\nကျွန်ုပ်တို့၏မူဝါဒပြောင်းလဲမှုများ \n\nစည်းမျဉ်းများကို လိုက်နာရန် ဤ Cookie Policy ကို အခါအားလျော်စွာ အပ်ဒိတ်လုပ်ပါမည်။ အပြောင်းအလဲများကို နားလည်ကြောင်း သေချာအောင် စစ်ဆေးရန် သင့်အား ကျွန်ုပ်တို့ တိုက်တွန်းပါသည်။ * ပြုပြင်ပြောင်းလဲမှုများ / နောက်ဆုံးမွမ်းမံမှုများ- 09/04/2021',
      'th':
          'โดยทั่วไปจะใช้เพื่อระบุการตั้งค่าภาษา และตำแหน่งที่ผู้ใช้เลือก เพื่อช่วยแสดงผลการใช้งานพื้นฐานของเว็บไซต์\nคุกกี้ของบุคคลที่สามคือคุกกี้ที่เผยแพร่โดยบุคคลที่สาม เช่น พันธมิตรทางธุรกิจหรือผู้ให้บริการของ Optimistic คุกกี้เหล่านี้อาจจำเป็นสำหรับการแสดงแบบฟอร์มบางอย่างบนเว็บไซต์ เช่น การส่งแบบฟอร์มใบสมัครงาน หรืออนุญาตให้โฆษณา Optimistic นอกเว็บไซต์\n\nคุกกี้ช่วงเวลา\n\nคุกกี้เหล่านี้เป็นคุกกี้ชั่วคราวที่ใช้เพื่อจดจำคุณในขณะที่คุณเยี่ยมชมเว็บไซต์ และจะหมดอายุลงเมื่อคุณปิดเว็บเบราว์เซอร์\n\nคุกกี้ถาวร\n\nคุกกี้ถาวรใช้เพื่อจดจำการตั้งค่าของคุณภายในเว็บไซต์ และจะยังคงอยู่ในเดสก์ท็อปหรืออุปกรณ์พกพาของคุณแม้ว่าคุณจะปิดเบราว์เซอร์และ/หรือเปิดอุปกรณ์ใหม่ เราใช้คุกกี้เหล่านี้เพื่อวิเคราะห์พฤติกรรมของผู้ใช้เพื่อสร้างรูปแบบการเข้าชมเพื่อให้เราสามารถปรับปรุงการทำงานของเว็บไซต์สำหรับคุณและผู้เยี่ยมชมเว็บไซต์ของ Optimistic คุกกี้เหล่านี้ยังช่วยให้เราสามารถส่งคุณไปยังโฆษณาที่ตรงเป้าหมายได้ และสามารถวัดประสิทธิภาพของฟังก์ชั่นของไซต์และโฆษณาของเราได้เช่นกัน \n\nคำอธิบายตัวอย่างการใช้คุกกี้เพื่อวัตถุประสงค์ในการโฆษณา \n\nคุกกี้และเทคโนโลยีโฆษณา เช่น เว็บบีคอน พิกเซล และแท็กเครือข่ายโฆษณาที่ไม่เปิดเผยตัวตน ช่วยให้เราส่งมอบโฆษณาที่คุณอาจสนใจได้อย่างมีประสิทธิภาพมากขึ้น เทคโนโลยีเหล่านี้ยังช่วยให้เราเก็บรวบรวมข้อมูลรวมสำหรับการตรวจสอบ การศึกษาวิจัย และการจัดทำรายงานประสิทธิภาพสำหรับบริษัทโฆษณา พิกเซลช่วยให้เราเข้าใจและปรับปรุงการส่งมอบโฆษณาให้กับคุณ และแจ้งให้เราทราบว่าคุณได้ดูโฆษณาใด และเนื่องจากเบราว์เซอร์ของคุณอาจดึงโฆษณาและเว็บบีคอนได้โดยตรงจากเซิร์ฟเวอร์เครือข่ายโฆษณา เครือข่ายเหล่านี้จึงสามารถดู แก้ไข หรือตั้งค่าคุกกี้ของตัวเองได้ราวกับว่าคุณกำลังร้องขอดึงหน้าเว็บจากไซต์เครือข่ายนั้นด้วยตนเอง \nแม้ว่าเราจะไม่ใช้คุกกี้เพื่อสร้างโปรไฟล์ของคุณจากประวัติของเว็บไซต์อื่น แต่เราใช้ข้อมูลรวมจากเว็บไซต์เหล่านี้เพื่อแสดงโฆษณาที่เกี่ยวข้องกับคุณ และตามความสนใจของคุณ เราจะไม่นำข้อมูลส่วนบุคคลของคุณไปยังบริษัทโฆษณา คุณอาจเลือกที่จะไม่รับโฆษณาจากนอกไซต์หรือโฆษณาที่แจ้งให้บุคคลที่สามทราบ การตั้งค่าคุกกี้ในเครื่องของคุณจะไม่ทำให้โฆษณาหายไปจากหน้าที่คุณเยี่ยมชม แต่โฆษณาที่คุณได้รับจะไม่ตรงกับความสนใจของคุณ ซึ่งหมายความว่าโฆษณาจะไม่ตรงกับความสนใจที่คุณมีซึ่งคุกกี้มี\n\nสำหรับฟังก์ชันบางอย่างภายในเว็บไซต์ของเรา เราจะใช้บริการที่จัดทำโดยบุคคลที่สาม เช่น เมื่อคุณเยี่ยมชมเว็บเพจที่มีการฝังวิดีโอ YouTube หรือลิงก์ไปยังวิดีโอ YouTube หรือลิงก์ (และเนื้อหาอื่นๆ ที่จัดทำโดยบุคคลที่สาม) อาจมีคุกกี้ของบุคคลที่สาม\n\nและเราขอแนะนำให้คุณตรวจสอบนโยบายความเป็นส่วนตัวของเว็บไซต์บุคคลที่สามเหล่านี้เพื่อค้นหาเกี่ยวกับการใช้คุกกี้ของพวกเขา\n\nวิธีการปฏิเสธและสามารถลบคุกกี้ได้\n\nคุณสามารถเลือกที่จะปฏิเสธ หรือบล็อกคุกกี้ทั้งหมดหรือคุกกี้บางส่วนที่เว็บไซต์ Optimistic สามารถตั้งค่าให้กับคุณได้ โดยการคลิกที่ปุ่มตั้งค่าคุกกี้บนเว็บไซต์ของเรา คุณสามารถเปลี่ยนการตั้งค่าของคุณบนเว็บไซต์ Optimistic และ/หรือเว็บไซต์ของผู้ให้บริการบุคคลที่สามที่กำหนดให้สำหรับคุณได้ การเปลี่ยนการตั้งค่าในเบราว์เซอร์ของคุณ โปรดทราบว่าเว็บเบราว์เซอร์ส่วนใหญ่จะยอมรับคุกกี้โดยอัตโนมัติ ดังนั้น หากคุณไม่ต้องการใช้คุกกี้ คุณอาจจำเป็นต้องบล็อกหรือลบคุกกี้ต่อไป หากคุณปฏิเสธที่จะใช้คุกกี้ คุณจะยังสามารถเยี่ยมชมเว็บไซต์ของเราได้ แต่ฟังก์ชันบางอย่างบนเว็บไซต์อาจไม่ถูกต้องหรือไม่ดีเท่าที่ควร คุณสามารถค้นหารายละเอียดเกี่ยวกับวิธีการปฏิเสธ หรือการลบคุกกี้ รวมถึงข้อมูลเพิ่มเติมทั่วไปเกี่ยวกับคุกกี้ได้ที่ \n\nคุกกี้ของเว็บไซต์: www.allaboutcookies.org/manage-cookies \n\nคุกกี้บนมือถือ: www.allaboutcookies.org/mobile/index.html \n\nInternet Advertising Bureau (IAB): www.youronlinechoices.com/uk/your-ad-choices \n\nNetwork Advertising Initiative (NAI): optout.networkadvertising.org/?c=1#!/ \n\nThe Digital Advertising Alliance (DAA): digitaladvertisingalliance.org/ \n\nการเยี่ยมชมเว็บไซต์โดยไม่ลบหรือปฏิเสธคุกกี้ดังกล่าว คุณยินยอมให้ Optimistic จัดเก็บคุกกี้ที่คุณไม่ปฏิเสธบนอุปกรณ์ของคุณ คุณจะลบคุกกี้ได้อย่างไร คุณสามารถลบคุกกี้ได้โดยทำตามลิงก์ต่อไปนี้ ตัวอย่างเช่น บนเว็บเบราว์เซอร์ที่คุณเลือกใช้ \n\nGoogle Chrome \n\nFirefox \n\nInternet Explorer \n\nSafari \n\nSafari สำหรับ ios \n\nChrome สำหรับ android \n\nChrome สำหรับ ios \n\nการเปลี่ยนแปลงนโยบายของเรา \n\nนโยบายคุกกี้จะได้รับการอัปเดตเป็นครั้งคราวเพื่อให้สอดคล้องกับระเบียบข้อบังคับ เราขอแนะนำให้คุณตรวจสอบเพื่อให้แน่ใจว่าคุณเข้าใจการเปลี่ยนแปลง * การปรับเปลี่ยน / การแก้ไขล่าสุด: 09/04/2021',
      'vi':
          'Thông thường, điều này được sử dụng để chỉ định cài đặt ngôn ngữ. Và vị trí do người dùng chọn để giúp hiển thị kết quả cho mục đích sử dụng cơ bản của trang web\nCookie của bên thứ ba là cookie do bên thứ ba phát hành, chẳng hạn như đối tác kinh doanh hoặc nhà cung cấp dịch vụ của Optimistic quản lý. Những cookie này có thể được yêu cầu để hiển thị một số biểu mẫu trên trang web, chẳng hạn như gửi biểu mẫu xin việc. Hoặc cho phép quảng cáo Optimistic ngoài trang web.\n\nCookie theo khoảng thời gian\n\nĐây là những cookie tạm thời được sử dụng để nhận dạng bạn trong khi bạn truy cập trang web. Và sẽ hết hạn khi bạn đóng trình duyệt web.\n\nCookie cố định\n\nCookie cố định được sử dụng để ghi nhớ các tùy chọn của bạn trong trang web. Và nó vẫn sẽ nằm trên máy tính để bàn hoặc thiết bị di động của bạn ngay cả khi bạn đóng trình duyệt và hoặc mở một thiết bị mới. Chúng tôi sử dụng những cookie này để phân tích hành vi của người dùng nhằm tạo ra các mẫu lưu lượng truy cập để chúng tôi có thể cải thiện các chức năng của trang web cho bạn. Và những người khác truy cập trang web của Optimistic. Những cookie này cũng cho phép chúng tôi hướng bạn đến các quảng cáo được nhắm mục tiêu. Và có thể đo lường hiệu quả của các chức năng của trang web và quảng cáo của chúng tôi.\n\nGiải thích ví dụ về cách cookie có thể được sử dụng cho mục đích quảng cáo. \n\nCookie và công nghệ quảng cáo như đèn hiệu web, pixel và thẻ mạng quảng cáo ẩn danh. Nó cho phép chúng tôi phân phối quảng cáo mà bạn có thể quan tâm hiệu quả hơn. Các công nghệ này cũng giúp chúng tôi thu thập thông tin tập thể để xem xét., nghiên cứu và chuẩn bị báo cáo hiệu suất cho các công ty quảng cáo. Pixel cho phép chúng tôi hiểu và cải thiện việc phân phối quảng cáo cho bạn và cho chúng tôi biết bạn đã xem quảng cáo nào Và vì trình duyệt của bạn có thể truy xuất quảng cáo và đèn hiệu web trực tiếp từ máy chủ mạng quảng cáo. Sau đó, các mạng này có thể xem, sửa đổi hoặc đặt cookie của riêng chúng như thể bạn đang yêu cầu thủ công để truy xuất các trang web từ trang web của mạng đó. \nMặc dù chúng tôi không sử dụng cookie để xây dựng hồ sơ của bạn từ lịch sử của các trang web khác, nhưng chúng tôi sử dụng thông tin tổng hợp từ các trang web này để hiển thị cho bạn các quảng cáo có liên quan. Và theo sở thích của bạn, chúng tôi không đưa thông tin cá nhân của bạn cho các công ty quảng cáo. Bạn có thể chọn không nhận quảng cáo ngoài trang web hoặc quảng cáo thông báo cho bên thứ ba. Bằng cách đặt cookie trong máy của bạn, cài đặt này không khiến quảng cáo biến mất khỏi các trang bạn đã truy cập. Nhưng quảng cáo bạn nhận được sẽ không khớp với sở thích của bạn. Điều này có nghĩa là quảng cáo sẽ không khớp với sở thích mà cookie lưu giữ. \nĐối với một số chức năng nhất định trong trang web của chúng tôi, chúng tôi sẽ sử dụng các dịch vụ do bên thứ ba cung cấp, ví dụ, khi bạn truy cập trang web có chứa video YouTube được nhúng hoặc liên kết đến video hoặc liên kết YouTube. (Và nội dung khác do bên thứ ba cung cấp) có thể chứa cookie của bên thứ ba. \nVà chúng tôi khuyến khích bạn xem lại chính sách bảo mật của các trang web của bên thứ ba này để tìm hiểu về cách họ sử dụng cookie. \n\nCách từ chối và có thể xóa cookie \n\nBạn có thể chọn từ chối. Hoặc chặn tất cả cookie hoặc một số cookie mà trang web Optimistic có thể đặt cho bạn. Bằng cách nhấp vào nút đặt cookie trên trang web của chúng tôi, bạn có thể thay đổi tùy chọn của mình trên trang web Optimistic và/hoặc trang web của nhà cung cấp dịch vụ bên thứ ba được chỉ định cho bạn. Bằng cách thay đổi cài đặt trong trình duyệt của bạn Xin lưu ý rằng hầu hết các trình duyệt web đều tự động chấp nhận cookie, vì vậy nếu bạn không muốn sử dụng cookie, bạn có thể cần tiếp tục chặn hoặc xóa cookie. Nếu bạn từ chối sử dụng cookie. Bạn vẫn có thể truy cập trang web của chúng tôi. Nhưng một số chức năng trên trang web có thể không chính xác hoặc không tốt như mong đợi. Bạn có thể tìm thông tin chi tiết về cách từ chối. Hoặc xóa cookie cũng như thông tin bổ sung chung về cookie có thể được tìm thấy tại \n\nCookie trang web: www.allaboutcookies.org/manage-cookies \n\nCookie di động: www.allaboutcookies.org/mobile/index.html \n\nInternet Advertising Bureau (IAB): www.youronlinechoices.com/uk/your-ad-choices \n\nNetwork Advertising Initiative (NAI): optout.networkadvertising.org/?c=1#!/ \n\nDigital Advertising Alliance (DAA): digitaladvertisingalliance.org/ \n\nTruy cập trang web mà không xóa hoặc từ chối cookie đó. Bạn đồng ý cho phép Optimistic lưu trữ cookie mà bạn không từ chối trên thiết bị của mình. Bạn xóa cookie như thế nào? Bạn có thể xóa cookie bằng cách làm theo các liên kết sau: Ví dụ: trên trình duyệt web mà bạn chọn sử dụng. \n\nGoogle Chrome \n\nFirefox \n\nInternet Explorer \n\nSafari \n\nSafari cho ios \n\nChrome cho android \n\nChrome cho ios \n\nNhững thay đổi trong chính sách của chúng tôi \n\nChính sách Cookie này sẽ được cập nhật thường xuyên để tuân thủ các quy định. Chúng tôi khuyến khích bạn kiểm tra để đảm bảo bạn hiểu những thay đổi. * Điều chỉnh / Lần sửa đổi cuối cùng: 09/04/2021',
      'zh_Hans':
          '这通常用于指定语言设置。以及用户选择的位置，以帮助显示网站基本使用的结果\n第三方 cookies 是由第三方管理发布的 cookies，例如 Optimistic 的业务合作伙伴或服务提供商。这些 cookies 可能是在网站上显示某些表格所必需的，例如提交工作申请表。或允许 Optimistic 的站外广告。\n\n间隔 Cookies\n\n这些是临时的 cookies，用于在您访问网站时识别您。当您关闭 Web 浏览器时，它们将过期。\n\n持久性 cookies\n\n持久性 cookies 用于记住您在网站内的偏好。即使您关闭浏览器或打开新设备，它仍将保留在您的桌面或移动设备上。我们使用这些 cookies 来分析用户行为，以生成流量模式，以便我们可以为您改进网站的功能。以及其他访问 Optimistic 网站的人。这些 cookies 还允许我们将您引导到有针对性的广告。并且可以衡量网站功能和我们广告的有效性。\n\n解释 cookies 如何用于广告目的的示例。\n\nCookies 和广告技术，例如网络信标、像素和匿名广告网络标签。它使我们能够更有效地投放您可能感兴趣的广告。这些技术还帮助我们收集集体信息以供审查、研究和为广告公司准备绩效报告。像素使我们能够了解和改进向您投放广告的方式，并让我们知道您一直在观看哪些广告，因为您的浏览器可能能够直接从广告网络服务器检索广告和网络信标。然后，这些网络可以查看、修改或设置自己的 cookie，就像您手动请求从该网络的站点检索网页一样。\n虽然我们不使用 cookie 从其他网站的历史记录中构建您的个人资料，但我们会使用这些网站的汇总信息向您展示相关广告。并且根据您的兴趣，我们不会将您的个人信息提供给广告公司。您可以选择不接收站外广告或通知第三方的广告。通过在您的机器中设置 cookie，此设置不会导致广告从您访问过的页面中消失。但您收到的广告将与您的兴趣不匹配。这意味着广告将不会与您拥有的 cookies 所持有的兴趣相匹配。\n对于我们网站内的某些功能，我们将使用第三方提供的服务，例如，当您访问包含嵌入的 YouTube 视频或指向 YouTube 视频或链接的网页时。（以及第三方提供的其他内容）可能包含第三方 cookie。\n并且我们鼓励您查看这些第三方网站的隐私政策，以了解他们对 cookie 的使用情况。\n\n如何拒绝和删除 cookie\n\n您可以选择拒绝。或阻止 Optimistic 网站可以为您设置的所有 cookie 或某些 cookie。通过单击我们网站上的设置 cookie 按钮，您可以更改 Optimistic 网站和/或为您指定的第三方服务提供商网站上的偏好设置。通过更改浏览器中的设置请注意，大多数网络浏览器都会自动接受 cookie，因此如果您不希望使用 cookie，则可能需要继续阻止或删除 cookie。如果您拒绝使用 cookie。您仍然可以访问我们的网站。但是网站上的某些功能可能不正确或不够好。您可以找到有关如何拒绝或删除 cookie 的详细信息以及有关 cookie 的一般附加信息，请访问 \n\n网站 Cookie：www.allaboutcookies.org/manage-cookies \n\n移动 Cookie：www.allaboutcookies.org/mobile/index.html \n\n互联网广告局 (IAB)：www.youronlinechoices.com/uk/your-ad-choices \n\n网络广告倡议 (NAI)：optout.networkadvertising.org/?c=1#!/ \n\n数字广告联盟 (DAA)：digitaladvertisingalliance.org/ \n\n访问网站而不删除或拒绝该 cookie。您同意允许 Optimistic 在您的设备上存储您不拒绝的 cookie。如何删除 cookie？您可以通过以下链接删除 cookie：例如，在您选择使用的 Web 浏览器上。\n\nGoogle Chrome \n\nFirefox \n\nInternet Explorer \n\nSafari \n\niOS 版 Safari \n\nAndroid 版 Chrome \n\niOS 版 Chrome \n\n政策变更 \n\n本 Cookie 政策将不时更新，以符合法规要求。我们建议您查看，以确保您了解变更。 * 调整/最后修改：2021 年 9 月 4 日',
